script: |
  super -f text -I q10400.spq | sort > q10400.out

inputs:
  - name: q10400.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT col0 / + 95 NOT BETWEEN ( + 98 * - col1 ) AND + col1;
  - name: tab1

outputs:
  - name: q10400.out
    data: |
      51	14	96
      85	5	59
      91	47	68
